import Layout from '../../components/MyLayout';

const Results = props => (
<Layout>
<p>{props.query}</p>

</Layout>
);

Results.getInitialProps = async function(context) {
  const { query } = context.query;
  console.log(query);
  return {query};
}

export default Results;
